window.bookSummaryJSON = "<p>Moments after the Jar of Stars is returned to its home dimension with unknown consequences, the Crystal Heart administrator makes a game-wide announcement to all NPCs offering a bounty of godhood to anyone who kills Mark or the ones he loves.</p> <p>Forced to immediately flee the tree city of Starglade, the only real option is to crack one of Audra’s old Recall Charms and teleport to a location labeled only as “Sanctuary”. But will Sanctuary live up to its name?</p> <p>Ancient mysteries, withered deities, bizarre societies, and enduring new allies all lie ahead of our heroes in a world dramatically changed by not only the choices they make but by their very presence. </p> <p>Warning: This series contains mature content.</p>"; 
